() => {
    if (config.resetModules) {
      runtime.resetModules();
    }
    if (config.clearMocks) {
      runtime.clearAllMocks();
    }
    if (config.resetMocks) {
      runtime.resetAllMocks();
      if (
        config.fakeTimers.enableGlobally &&
        config.fakeTimers.legacyFakeTimers
      ) {
        // during setup, this cannot be null (and it's fine to explode if it is)
        environment.fakeTimers.useFakeTimers();
      }
    }
    if (config.restoreMocks) {
      runtime.restoreAllMocks();
    }
  }

() => {
    if (config.resetModules) {
      runtime.resetModules();
    }
    if (config.clearMocks) {
      runtime.clearAllMocks();
    }
    if (config.resetMocks) {
      runtime.resetAllMocks();
      if (
        config.fakeTimers.enableGlobally &&
        config.fakeTimers.legacyFakeTimers
      ) {
        // during setup, this cannot be null (and it's fine to explode if it is)
        environment.fakeTimers.useFakeTimers();
      }
    }
    if (config.restoreMocks) {
      runtime.restoreAllMocks();
    }
  }

async () => {
    await device.disableSynchronization();
    await waitFor(element(by.id('create_wallet'))).toBeVisible().withTimeout(5000);
    await element(by.id('create_wallet')).longPress();
    await waitFor(element(by.id('password'))).toBeVisible().withTimeout(5000);
    await element(by.id('password')).replaceText('Hello, World!');
    await element(by.id('confirmPassword')).replaceText('Hello, World!');
    await new Promise(resolve => {
      setTimeout(async () => {
        await element(by.id('continue')).longPress();
        resolve();
      }, 3000);
    });
    await new Promise(resolve => {
      setTimeout(() => {
        resolve();
      }, 6000);
    });
    // await waitFor(element(by.text('Recovery Phrase')))
    //   .toBeVisible()
    //   .withTimeout(5000);
    await expect(element(by.text('Recovery Phrase'))).toBeVisible();
  }
